import React from "react";
import "./AboutSection.css"

const AboutSection = () => {
  return <div id="about-container">
        <h1 id="about-title">About us</h1>
        <p id="about-text">We provide repair services for refrigerators, washers, dryers, dishwashers, ovens, and cooktops. Our technicians have 5-10 years of experience and are certified by major American appliance brands. Additionally, we are licensed, bonded, and insured. All services are performed on-site using only original parts. License number - MAJORAR785C2. All services are performed on the site using only original parts!</p>
    </div>
};

export default AboutSection;
